Matrix3f DCM() {
	Vector4f q = state.block<4,1>(6,1);
	Matrix3f dcm;

	dcm << 1-2*q(3)*q(3)-2*q(4)*q(4), 2*q(2)*q(3)+2*q(4)*q(1), 2*q(2)*q(4)-2*q(3)*q(1),
           2*q(2)*q(3)-2*q(4)*q(1), 1-2*q(2)*q(2)-2*q(4)*q(4), 2*q(3)*q(4)+2*q(2)*q(1),
           2*q(2)*q(4)+2*q(3)*q(1), 2*q(3)*q(4)-2*q(2)*q(1), 1-2*q(2)*q(2)-2*q(3)*q(3);
	return dcm;
}
Matrix4f omega() {
	Vector3f w = gyro;
	Vector3f gyroBias = state.block<3,1>(13,1);
	w  -= gyroBias;
	w = DCM() * w;
	Matrix4f omega;
	omega << 0,		-w(0),	-w(1),	-w(2),
			 w(0),	0,		w(2),	-w(1),
			 w(1), 	-w(2), 	0, 		w(0),
			 w(2),	w(1), 	-w(0), 	0;

	return omega;
}
// Calculates Predicted Next State.
void state_prediction () {

	/*
 * state-> 	0:2 position
 * 			3:5 velocity
 * 			6:9 quaternions
 * 			10:12 acc bias
 * 			13:15 gyro bias
 */
	//Get Xdelta.

	VectorXf xdelta(STATENUM); //dynamic allocation maybe.
	//Position
	xdelta[0] = state[3];
	xdelta[1] = state[4];
	xdelta[2] = state[5];

	//Velocity
	//initialize the DCM using quaternions from state.
	xdelta.block<3,1>(3,1) = DCM() *  acc;
	//xdelta(5) = xdelta(5) + 9.816;

	//Quaternions
	/*
	 * To compute quaternion transition, first compute angular velocity vector
	 */

	xdelta.block<4,1>(6,1) = 0.5 * Sampling_Time * omega() * state.block<4,1>(6,1);

	//Biases
	//xdelta.block<6,1>(10,1) = 0;

	state += Sampling_Time*xdelta;

}

MatrixXf Xi() {
	MatrixXf Xi(4,3);
	Vector4f q = state.block<4,1>(6,1);
	Xi << -q(1), -q(2), -q(3),
			q(0), -q(4), q(2),
			q(3), q(0), -q(1),
			-q(2), q(1), q(0);
	return Xi;
}
MatrixXf Q() {
	Matrix<float, 12, 12> Q;
	Matrix3f zeros3 = Matrix<float, 3, 3>::Zero();
	Matrix3f Qgyro;
	Matrix3f Qacc;
	Matrix3f Qgyrobias;
	Matrix3f Qaccbias;

	Qgyro << 	0.1679,   -0.0615,   -0.1051,
			   -0.0615,    0.1320,   -0.0654,
			   -0.1051,   -0.0654,    0.2536;
	Qgyro *= 1.0e-03;


	Qacc << 	0.6670,    0.0377,   -0.0648,
				0.0377,    0.8222,   -0.1422,
			   -0.0648,   -0.1422,    2.7314;
	Qacc *= 1.0e-03;


	Qgyrobias << 	0.3552,   -0.0323,   -0.2509,
				   -0.0323,    0.2822,   -0.2381,
				   -0.2509,   -0.2381,    0.5686;
	Qgyrobias *= 1.0e-06;


	Qaccbias << 	0.3501,   -0.1312,    0.2149,
				   -0.1312,    0.4719,   -0.2273,
					0.2149,   -0.2273,    1.3670;
	Qaccbias *= 1.0e-05;

	Q << 	Qgyro, zeros3, zeros3, zeros3,
			zeros3, Qacc, zeros3, zeros3,
			zeros3, zeros3, Qgyrobias, zeros3,
			zeros3, zeros3, zeros3, Qaccbias;
	return Q;
}
Matrix16f F() {
// Porting the equations direct from Matlab...
	MatrixXf Fvqparts = Xi() * acc;

	MatrixXf Fvq(3,4);
	Fvq <<	Fvqparts(1), -Fvqparts(0), Fvqparts(3), -Fvqparts(2),
			Fvqparts(2), -Fvqparts(3), -Fvqparts(0), Fvqparts(1),
			Fvqparts(3), Fvqparts(2), -Fvqparts(1), -Fvqparts(0);
	Fvq*=2;
	/*********************/
	Matrix3f Fvba = -DCM().transpose();
	Matrix4f Fqq = 0.5 * omega();
	Matrix3f Fqbw = -0.5 * Xi();
	/********/
	//Build F matrix
	Matrix16f F;
	Matrix3f eye3= Matrix3f::Identity();
	Matrix3f zeros3= Matrix3f::Zero();

	F << 	zeros3, eye3, Matrix<float, 3, 10>::Zero(),
			zeros3, zeros3, Fvq, zeros3, Fvba,
			Matrix<float, 4, 6>::Zero(), Fqq, Fqbw, Matrix<float, 4, 3>::Zero(),
			Matrix<float, 6, 16>::Zero();
	F *= Sampling_Time;
	F+= Matrix<float, 16, 16>::Identity();
	return F;
}
Matrix16f G() {
	MatrixXf Gqww = 0.5 * Xi();
	Matrix3f Gvwa = DCM().transpose();
	Matrix16f G;
	G << Matrix<float, 3, 12>::Zero(),
			Matrix<float, 3, 3>::Zero(), Gvwa, Matrix<float, 3, 6>::Zero(),
			Gqww, Matrix<float, 4, 9>::Zero(),
			Matrix<float, 3, 6>::Zero(), Matrix<float, 3, 3>::Identity(), Matrix<float, 3, 3>::Zero(),
			Matrix<float, 3, 9>::Zero(), Matrix<float, 3, 3>::Identity();
	G *= Sampling_Time;
	return G;
}
void covariance_prediction() { //Create a function to build P up in step3.
	Matrix16f P_old = P.block<16,16>(0,0);
	P.block<16,16>(0,0) = F()*P.block<16,16>(0,0)*F().transpose() + G()*Q()*G().transpose();
	// Should we propagate any change to the other blocks of P?
}

//Build H for given Landmark/plane.
MatrixXf H_fn(int planeId) { // Incomplete. Consider H data management.
	// H is a diagonal matrix.
	int size = landmarks.size() * 4;
	MatrixXf H(4, size + 16);
	// Build H for each plane.
	MatrixXf Xip(4,3);
	Vector4f q = state.block<4,1>(6,1);
	Xip << 	q(1), -q(2), -q(3),
			-q(0), -q(3),  q(2),
			q(3),  -q(0), -q(1),
			-q(2),  q(1),  -q(0);

	Vector4f plane = landmarks.getPlane(planeId);

	MatrixXf Hqparts = Xip * plane.block<3,1>(1,1); //Nx,Ny Nz
	MatrixXf Hq(3,4);
	Hq << -Hqparts(1,0), -Hqparts(0,0), Hqparts(3,0), -Hqparts(2,0),
			   -Hqparts(2,0), -Hqparts(3,0), -Hqparts(0,0), Hqparts(1,0),
			   -Hqparts(3,0), Hqparts(2,0), -Hqparts(1,0), -Hqparts(0,0);
	Hq*=2;

	MatrixXf block(4,3);
	MatrixXf block2(4,3);
	Matrix4f block3(4,4);
	block << Matrix<float, 3, 3>::Zero(), plane.block<3,1>(1,1).transpose();
	block2 << Hq, Matrix<float, 1, 3>::Zero();

	block3 << DCM(),  Matrix<float, 3, 1>::Zero(), state.block<3,1>(0,0).transpose(), 1;


	H << 	block,  	Matrix<float, 4, 3>::Zero(), 	block2,		Matrix<float, 4, 6>::Zero(),
			MatrixXf::Zero(4, 4*(planeId)), block3,  MatrixXf::Zero(4, size-4*planeId);
			//Incomplete construction.
	return H;
}

void update() {
	//Data Association.
	for (int i = 0; i < (signed)newPlanes.size(); i++) {
		for (int j = 0; j < landmarks.size(); j++) {
			MatrixXf H = H_fn(j);
			MatrixXf S = H*P*H.transpose();
			Matrix4f S_temp = S + newPlanes[i].cov * covFactor;
			double dist = landmarks.getMahaDist(landmarks.getPlane(j), newPlanes[i].plane, S_temp);
			if (dist < distThreshold) {
				//Data association is successful!
				newPlanes[i].isMatched = true;
				landmarks.increaseCount(i);
				Vector4f plane_diff = newPlanes[i].plane - landmarks.getPlane(j);
				MatrixXf kalmanGain = P * H.transpose() * S.inverse();
				state+= kalmanGain.block<16,1>(0,0);
				//update landmarks.
				for (int k = 0; k < landmarks.size(); k++) {
					Vector4f delta = kalmanGain.block<4,1>(16 + 4*k,1);
					landmarks.updatePlane(k, delta);
					//update covariance.
					Matrix4f dCov = kalmanGain*H*P;
					landmarks.updateCov(k,dCov);
				}
 				// addition to state.
				break;
			}
		}
	}
}
void getNewMeasurement() {
	acc << accList(accPtr++), accList(accPtr++),accList(accPtr++);
	gyro << gyroList(gyroPtr++), gyroList(gyroPtr++),gyroList(gyroPtr++);
	if(accPtr >= Steps || gyroPtr >= Steps) {
		accPtr  = 0;
		gyroPtr = 0;
	}
}
void getNewObservation() {
	newPlanes.clear();
	int len = planeList[planePtr++];
	for (int i = 0; i<len;) {
		Vector4f plane_t;
		Matrix4f cov_t;
		plane_t << planeList[planePtr++], planeList[planePtr++], planeList[planePtr++],planeList[planePtr++];
		 cov_t << planeList[planePtr++], planeList[planePtr++], planeList[planePtr++],planeList[planePtr++],
				 planeList[planePtr++], planeList[planePtr++], planeList[planePtr++],planeList[planePtr++],
				 planeList[planePtr++], planeList[planePtr++], planeList[planePtr++],planeList[planePtr++],
				 planeList[planePtr++], planeList[planePtr++], planeList[planePtr++],planeList[planePtr++];
		 planes_struct* temp = new planes_struct();
		 temp->cov = cov_t;
		 temp->plane = plane_t;
		 newPlanes.push_back(*temp);
	}
	if (planePtr >= Steps) {
		planePtr = 0;
	}
}
void run() {
	//First initialize.
	void initialisation();
	while(timeSteps < Steps) {
		timeSteps++;
		//Get measurements. Important step.
		getNewMeasurement();
		state_prediction ();
		covariance_prediction();
		getNewObservation();
		update();
		statehistory.push_back(state);
	}
}
